import React from 'react';
import { Card,Image,Embed,Icon } from 'semantic-ui-react'
import { Button } from 'react-bootstrap';

export default class Projects extends React.Component{

    render(){
        const EmbedExampleYouTube = () => (
            <Embed
              id='O6Xo21L0ybE'
              placeholder='/images/image-16by9.png'
              source='youtube'
            />
          )

        return(
            <div>
                <div class="projectsheader">
                <h1 class="projectsheader">Projects___</h1> 
                </div>
                <div class="projectContainer">
                <Card.Group itemsPerRow={3}>
                <div class="container">
                <img src="https://www.ideveloppement.fr/application/uploads/resources/barney_fond_bleu/barney-ideveloppement-bleu-600.png" alt="Avatar" class="image"/>
                <div class="overlay">
                    <div class="text">Hello World</div>
                </div>
                </div>
                </Card.Group>
                </div>

            </div>
        )
    }
}
